import React from 'react';
import {Container, Jumbotron} from "react-bootstrap";

class Home extends React.Component {
    constructor(props) {
        super(props);
        document.title = "Home";
    }

    render() {
        return (
            <Container>
                <h1>Title</h1>
            </Container>
        );
    }
}

export default Home;
